#define eb emplace_back
#define fr first
#define sc second

string s;

int main() {
	cin >> s;
	int cw = 0, cb = 0;
	for (int i = 0;i < s.size();i++) {
		if (s[i] == 'B')cb++;
		else if (s[i] == 'W')cw++;
	}
	if (cb > cw)cout << "Black wins" << endl;
	else if (cb < cw)cout << "White wins" << endl;
	else cout << "Draw" << endl;
	return 0;
}
